@Nullable
    static TrackLabels from(@NonNull List<MLocation> points) {
        try {
            final TrackLabels labels = findExitLand(points);
            if (labels != null) {
                labels.deploy = findDeploy(points, labels.exit, labels.land);
            }
            return labels;
        } catch (Exception e) {
            Exceptions.report(e);
            return null;
        }
    }
